import { useState } from "react";

export default function Login(){

    const [ Form , setFormData ] = useState({})
const navigate = useNavigate() ; 
const id='aman';
const pass='12';

if ( 
 id==Form.id && pass==Form.pass
){
navigate('admin');

}

else{
    alert('no gateway');
}
};



const All=(e)=>{

    setFormData(Form=> ({...Form,[e.target.name]: e.target.value }))


    return(
        <div className="body-white">

                <div className="login-logo">
                    <img src="https://icssms.stomer.in/img/core-img/logo-small.png"/>

                </div>
                    <h3 className="login-heading1">Jrsu institute</h3>

            <h3 className="login-heading2">User Login</h3>

            <div className="login-box">


                <div className="login-form">
                    <input className="login-form-data" type="text" placeholder="username" name="name" onChange={All}/>
                    <br/>
                    <input className="login-form-data" type="password" placeholder="password" name="password" onChange={All}/>
                    <br/>
                    <button className="login-button">log in</button>
                </div>

            </div>

        </div>
    )
}
